import React from 'react';

// Pictures
import BgDesktop from '../images/bg-main-desktop.png';
import BgMobile from '../images/bg-main-mobile.png';

function Picture() {
  return (
    <div className='xl:h-full h-[20%] 2xl:w-[35%] lg:w-[25%] w-full'>
      <img className='lg:block hidden w-full h-full object-fill' src={BgDesktop} alt="Background pic" />
      <img className='lg:hidden block' src={BgMobile} alt="Background pic" />
    </div>
  )
}
export default Picture;
